import axios from "axios";

function Image() {
    const [images, setImages] = useState([])

    const showImages = async (event) => {
        event.preventDefault();

        const response = await axios.get(
          "https://www.flickr.com/services/rest/?method=flickr.photos.search&api_key=f5e3dc5e6886a1e7799eeb85aad99cb5&tags=chennai&per_page=20&page=1&format=json&nojsoncallback=1"
        );
        setImages(response.data.photos);
      };
    // const srcPath = 'https://farm'+pic.farm+'.staticflickr.com/'+pic.server+'/'+pic.id+'_'+pic.secret+'.jpg';

    return (
        <div>
            <h1>Images</h1>
        </div>
    )
}

export default Image
